import React from 'react';
import { Container } from 'react-bootstrap';



export const Footer = () => {
    return (
        <Container className='text-center mt-5'>
            <hr />
            <p>&copy; 2023 React WebSite. All rights reserved</p>
        </Container>
    );
};

export default Footer;
